import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

// console.log(Sdata[0].sname);





const App = ()=> (
  <>
    <h1 className="heading_style">List of top 5 Netflix Series 2020</h1>
    {Sdata.map((value, index) => {
     console.log(index);
  return (
    <Card
      key = {value.id}
      imgsrc={value.imgsrc}
      title={value.title}
      sname={value.sname}
      link={value.link}
    />
  );
}
    )}
  </>

);

export default App;
